import React, {Component} from "react";
import './App.css';
import Header from "./components/Header";
import Navbar from "./components/Navbar";


const App = () => {
  return (
    <div className="app-wrapper">
        <Header/>
        <Navbar/>
        <div className='content'>
            <div>
                <img src='https://www.bmw.by/content/dam/bmw/common/all-models/4-series/gran-coupe/2021/navigation/bmw-4-series-gran-coupe-modelfinder-890x501.png'/>
            </div>
            <div>
                New post
            </div>
            <div>
                New car
            </div>
        </div>
    </div>
  );
}

export default App;
